import React from "react";
// import { Button } from "../components/ui/button";
import { Button } from "@/components/ui/button";

const Header = () => {
  return (
    <div>
      <div>
        <h1 class="text-4xl font-bold p-4">Notes</h1>
      </div>
      <div>
        <Button variant="outline">Button</Button>
      </div>
    </div>
  );
};

export default Header;
